import React, { ReactElement, useEffect, useState } from "react";
import { IUser } from "./interfaces";
import api from "./services/api";
import './App.css'

//rotas
import {Routes, Route, Link} from 'react-router-dom'
import Header from "./components/Header/Header";
import Home from "./templates/Home";
import Card from "./components/Card/Card";
import Users from "./templates/Users";


export default function App() {
  const [users, setUserGet] = useState([]);
  // const elementUsers : Array<ReactElement> = [];
  const [elementUsers, setElement] = useState<Array<any, any>>();

  useEffect(() => {
   api
     .get("/v1/Users")
     .then((response) => ((setUserGet(response.data))))
     .catch((err) => {
       console.error("ops! ocorreu um erro" + err);
     });
  }, []);

  useEffect(() => {
    users.forEach((e: IUser) => { 
      setElement( <tr>
                    <th scope="row">1</th>
                    <td>{e.name}</td>
                    <td>{e.phone}</td>
                    <td>{e.account.numberAccount}</td>
                  </tr>) 
    })
  })

  return (
    <div className="App">
        <Header/>
        <main>
          <Routes>
            <Route path="/" element={<Home/>}></Route>
            <Route path="/users" element={<Users dados={elementUsers}/>}></Route>
          </Routes>
        </main>
    </div>  
  );
}
